import React from "react";
import getData from "./fetch";

const songName = 'Lose yourself';

getData(songName);

function SongList () {

  return (
    <div className="main">
      <div className="songList">
        <h2>Results</h2>
      </div>

      <div className="songList">
        <h2>Playlist</h2>
      </div>
    </div>
  )
}

export default SongList;
